import React from "react";

function App() {

  function handleChange(event){
    const header = event.target.value;

  }

  return (
    <div className="container">
      <h1>{header} </h1>
      <input onChange={handleChange} type="text" placeholder="What's your name?" />
      <button>Submit</button>
    </div>
  );
}

export default App;
